# Graph Helper Functions
def addNodes(G,n):
    for x in n:
        G[x]=[]
    return G
    
# =========================================
def addEdges(G,edges,directed=False):
    
    for x in edges:
        key = x[0]
        edge = (x[1],x[2])
        G[key].append(edge)
    if(not directed):
        for x in edges:
            key = x[1]
            edge = (x[0],x[2])
            if(edge not in G[key]):
                G[key].append(edge)
    return G
        
# =========================================

def listOfNodes(G):
    return list(G.keys())
# ==========================================


def listOfEdges(G,directed =False):
    edge_lst=[]
    if(directed):
        for x in G:
            if(len(G[x])>0):
                for y in G[x]:
                    edge = (x,y[0],y[1])
                    edge_lst.append(edge)
        return edge_lst
    else:
        for x in G:
            if(len(G[x])>0):
                for y in G[x]:
                    a=min(x,y[0])
                    b=max(x,y[0])
                    edge = (a,b,y[1])
                    if(edge not in edge_lst):
                        edge_lst.append(edge)
        return edge_lst

    
