def printIn_OutDegree(G):
    deg ={}
    for x in G:
        deg[x]={'inD':0,'outD':0}
    for x in G:
        deg[x]['outD'] = len(G[x])
        for y,z in G[x]:
            deg[y]['inD']+=1
    
    for x in deg:
        print(x,'=> In-Degree:',deg[x]['inD'],', Out-Degree:', deg[x]['outD'])

