def getInNeighbours(G,node):
    lst = []
    for x in G:
        for y in G[x]:
            if(y[0]==node):
                lst.append(x)
                break
    return lst

# ================================================


def getOutNeighbours(G,node):
    lst = []
    for x in G[node]:
        lst.append(x[0])
    return lst

# ================================================

def getNearestNeighbor(G,node):
    nearest = False
    for x in G[node]:
        if(not nearest):
            nearest = x
        elif(x[1]<nearest[1]):
            nearest=x
    return nearest[0]

# ==================================================

def isNeighbor(G,n1,n2):
    for x in G[n1]:
        if(x[0]==n2):
            return True
    return False



# ==================================================
def removeNode(G,node):
    G.pop(node,None)
    vals = getInNeighbours(G,node)
    for x in vals:
        for y in G[x]:
            if(y[0]==node):
                G[x].remove(y)
                break
    return G
# =============================================

def removeNodes(G,nodes):
    for node in nodes:
        G.pop(node,None)
        vals = getInNeighbours(G,node)
        for x in vals:
            for y in G[x]:
                if(y[0]==node):
                    G[x].remove(y)
                    break
                    
    return G

