def display_adj_matrix(G):
    matrix=[]
    for x in G:
        temp = []
        for x in G:
            temp.append(0)
        matrix.append(temp)

    for x in G:
        for y in G[x]:
            matrix[x][y[0]]=y[1]
    return(matrix)

    
def Enqueue(queue, item, priority):
    tup = (item,priority)
    if(len(queue)==0):
        queue.append(tup)
    else:
        for x in range(len(queue)):
            if (queue[x][1]>=priority):
                queue.insert(x,tup)
                return queue
        queue.append(tup)
        return queue

def Dequeue(queue):
    val = queue.pop(0)
    return val[0]

