"""**Exercise # 2:**

Write a function named “MSTKruskals(EL, N)” and implement Kruskal’s algorithm to determine the Minimum Spanning Tree in the following graph.

![lab_13_b.png](data:image/png;base64,)

"""

# solution to Exerise 2
edges=[('A', 'D', 3), ('A', 'B', 5), ('A', 'E', 6), ('B', 'C', 6), ('C', 'G', 2),('C', 'D', 10), ('D', 'F', 8), ('G', 'F', 10), ('E', 'F', 9)]

def MSTKruskals(edges,N):
  edges = sorted(edges, key=lambda item: item[2])
  visited =[]
  path = []
  while(edges != [ ]):
    e = edges.pop(0)
    s = e[0]
    t = e[1]
    w = e[2]

    if( t not in visited):
      visited+=[t]
      a = (t,s,w)
      if(a not in path):
        path.append(e)
  return path

print(MSTKruskals(edges, 'A'))

